import React from 'react';
import styled from 'styled-components';
import * as C from 'components/a-commons';

const TestContainer = styled.div`
  display: flex;
  flex-direction: column;
  background-color:#eee;
  align-items: center;
  justify-content: center;
  width:100vw;
  height:100vh;
`;

export const Test = () => {
  return (
    <TestContainer>
      <C.Headline1>Single Component Test Ground</C.Headline1>
    </TestContainer>
  )
}
